import React from "react";
import classes from './Input.module.css';

const Input = (props) => {
  return (
    <input
      type={props.type}
      id={props.id}
      value={props.value}
      onChange={props.onChange}
      onBlur={props.onBlur}
      className={`${classes.input} ${props.className}` }
    >
      {props.childern}
    </input>
  );
};

export default Input;
